import React, { useEffect, useState } from 'react';

const normalizeName = (name) =>
  name
    .toLowerCase()
    .replace(/\./g, '')
    .replace(/[^a-z\s-]/g, '')
    .replace(/\s+/g, '-');

const WRSeparationMap = () => {
  const [data, setData] = useState([]);
  const [hovered, setHovered] = useState(null);

  useEffect(() => {
    fetch('/data/elite_leaderboard.csv')
      .then(res => res.text())
      .then(text => {
        const [header, ...rows] = text.trim().split('\n');
        const cols = header.split(',');

        const parsed = rows.map(r => {
          const v = r.split(',');
          const row = {};
          cols.forEach((c, i) => (row[c] = v[i]));
          return {
            player: row.player_name,
            wos: +row.Advanced_WOS,
            exp: +row.exp_sep_xgb,
            targets: +row.play_id,
            img: `/headshots/${normalizeName(row.player_name)}.jpg`
          };
        });

        setData(parsed.filter(d => !isNaN(d.wos) && !isNaN(d.exp)));
      });
  }, []);

  if (!data.length) return <div>Loadingâ€¦</div>;

  /* ----- Chart config ----- */
  const W = 1000; // bigger width
  const H = 900;  // bigger height
  const P = 100;  // padding around edges


  const xs = data.map(d => d.wos);
  const ys = data.map(d => d.exp);

  const xMin = Math.min(...xs) - 0.05;
  const xMax = Math.max(...xs) + 0.05;
  const yMin = Math.min(...ys) - 0.2;
  const yMax = Math.max(...ys) + 0.2;

  const medianY =
    [...ys].sort((a, b) => a - b)[Math.floor(ys.length / 2)];

  const x = v => P + ((v - xMin) / (xMax - xMin)) * (W - P * 2);
  const y = v => H - P - ((v - yMin) / (yMax - yMin)) * (H - P * 2);

  return (
    <div className="bg-white p-6 rounded-xl shadow-lg">
      <h2 className="text-2xl font-bold text-center mb-1">
        WR Separation Map
      </h2>
      <p className="text-center text-gray-500 mb-4">
        Expected vs Created Separation
      </p>

      <div className="relative">
        <svg width={W} height={H}>
          {/* Quadrant backgrounds */}
          <rect x={x(0)} y={P} width={W - x(0) - P} height={y(medianY) - P}
            fill="#ecfeff" />
          <rect x={x(0)} y={y(medianY)} width={W - x(0) - P} height={H - y(medianY) - P}
            fill="#f0fdf4" />

          {/* Axes */}
          <line x1={P} y1={H-P} x2={W-P} y2={H-P} stroke="#333"/>
          <line x1={P} y1={P} x2={P} y2={H-P} stroke="#333"/>

          {/* Reference lines */}
          <line
            x1={x(0)}
            x2={x(0)}
            y1={P}
            y2={H-P}
            stroke="#666"
            strokeDasharray="6,6"
          />
          <line
            x1={P}
            x2={W-P}
            y1={y(medianY)}
            y2={y(medianY)}
            stroke="#666"
            strokeDasharray="6,6"


          />


          {/* X-axis label */}
<text x={W/2} y={H - 30} textAnchor="middle" fill="#111" fontSize="16">
  Created Separation (WOS)
</text>

{/* Y-axis label */}
<text
  x={30}
  y={H/2}
  textAnchor="middle"
  fill="#111"
  fontSize="16"
  transform={`rotate(-90, 30, ${H/2})`}
>
  Expected Separation
</text>



          {/* Points */}
          {data.map(d => {
              const size = Math.min(Math.sqrt(d.targets) * 5, 80); // max 80px

              return (
                <g
                  key={d.player}
                  onMouseEnter={() => setHovered(d)}
                  onMouseLeave={() => setHovered(null)}
                >
                  <image
                    xlinkHref={d.img}
                    x={x(d.wos) - size / 2}
                    y={y(d.exp) - size / 2}
                    width={size}
                    height={size}
                    preserveAspectRatio="xMidYMid slice"
                  />
                </g>
              );
            })}

        </svg>

        {/* Hover card */}
        {hovered && (
          <div className="absolute right-4 top-4 bg-white border shadow-xl rounded-lg p-4 w-60">
            <div className="font-bold">{hovered.player}</div>
            <div className="text-sm text-gray-600 mt-1">
              Targets: {hovered.targets}
            </div>
            <div className="text-sm">
              Created Sep: {hovered.wos.toFixed(2)}
            </div>
            <div className="text-sm">
              Expected Sep: {hovered.exp.toFixed(2)}
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default WRSeparationMap;
